import React from "react";
import styled from "styled-components";

const StyledButton = styled.button``;

const Button = ({ name, func, value, id }) => {
  return (
    <StyledButton onChange={func} value={value} name={name}>
      {name}
    </StyledButton>
  );
};

export default Button;
